icon" href="/static/favicon/wikipedia.ico"/> <link rel="search" type="application/opensearchdescription+xml" href="/w/opensearch_desc.php" title="Wikipedia (en)"/> <link rel="EditURI" type="application/rsd+xml" href="//en.wikipedia.org/w/api.php?action=rsd"/> <link rel="license" href="//creativecommons.org/licenses/by-sa/3.0/"/> <link rel="canonical" href="https://en.wikipedia.org/wiki/Go-oo"/> <link rel="dns-prefetch" href="//login.wikimedia.org"/> <link rel="dns-prefetch" href="//meta.wikimedia.org" /> <!--[if lt IE 9]><script src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Go-oo rootpage-Go-oo skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Go-oo</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"><span class="mw-redirectedfrom">  (Redirected from <a href="/w/index.php?title=Gooo&amp;redirect=no" class="mw-redirect" title="Gooo">Gooo</a>)</span></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table class="infobox vevent" style="width:22em"> <caption class="summary">Go-oo</caption> <tr> <th scope="row" style="white-space: nowrap;">Initial release</th> <td>October&#160;8, 2007<span class="noprint">; 10 years ago</span><span style="display:none">&#160;(<span class="bday dtstart published updated">2007-10-08</span>)</span></td> </tr> <tr style="display: none;"> <td colspan="2" style="text-align:center"></td> </tr> <tr> <th scope="row" style="white-space: nowrap;"><a href="/wiki/Software_release_life_cycle" title="Software release life cycle">Last release</a></th> <td> <div style="margin:0px;">3.2.1-11 / July&#160;21, 2010<span class="noprint">; 7 years ago</span><span style="display:none">&#160;(<span class="bday dtstart published updated">2010-07-21</span>)</span><sup id="cite_ref-1" class="reference"><a href="#cite_note-1">[1]</a></sup></div> </td> </tr> <tr style="display:none"> <td colspan="2"></td> </tr> <tr> <th scope="row" style="white-space: nowrap;">Development status</th> <td>Discontinued in favour of <a href="/wiki/LibreOffice" title="LibreOffice">LibreOffice</a></td> </tr> <tr> <th scope="row" style="white-space: nowrap;">Written in</th> <td><a href="/wiki/C%2B%2B" title="C++">C++</a></td> </tr> <tr> <th scope="row" style="white-space: nowrap;"><a href="/wiki/Operating_system" title="Operating system">Operating system</a></th> <td><a href="/wiki/Microsoft_Windows" title="Microsoft Windows">Microsoft Windows</a>, <a href="/wiki/Linux" title="Linux">Linux</a> and <a href="/wiki/Mac_OS_X" class="mw-redirect" title="Mac OS X">Mac OS X</a></td> </tr> <tr> <th scope="row" style="white-space: nowrap;"><a href="/wiki/Software_categories#Broad_categories" title="Software categories">Type</a></th> <td><a href="/wiki/Office_suite" class="mw-redirect" title="Office suite">Office suite</a></td> </tr> <tr> <th scope="row" style="white-space: nowrap;"><a href="/wiki/Software_license" title="Software license">License</a></th> <td><a href="/wiki/GNU_Lesser_General_Public_License" title="GNU Lesser General Public License">GNU Lesser General Public License</a></td> </tr> <tr> <th scope="row" style="white-space: nowrap;">Website</th> <td><code>go-oo.org</code> (defunct)</td> </tr> </table> <p><b>Go-oo</b> (also <b>Go-Open Office</b>;<sup id="cite_ref-ITPro_2-0" class="reference"><a href="#cite_note-ITPro-2">[2]</a></sup> previously called <b>ooo-build</b><sup id="cite_ref-slashdot_3-0" class="reference"><a href="#cite_note-slashdot-3">[3]</a></sup>) was an <a href="/wiki/Office_suite" class="mw-redirect" title="Office suite">office suite</a> which started as a set of patches for <a href="/wiki/OpenOffice.org" title="OpenOffice.org">OpenOffice.org</a>, then later became an independent fork of OpenOffice.org with a number of enhancements, sponsored by <a href="/wiki/Novell" title="Novell">Novell</a>.</p> <p>ooo-build was started in 2003. The go-oo.org <a href="/wiki/Domain_name" title="Domain name">domain name</a> was being used by 2005.<sup id="cite_ref-4" class="reference"><a href="#cite_note-4">[4]</a></sup> The first separate release of Go-oo was 2.3.0, in October 2007. Go-oo was discontinued in favour of <a href="/wiki/LibreOffice" title="LibreOffice">LibreOffice</a> in September 2010.<sup id="cite_ref-meeks_der_standard_5-0" class="reference"><a href="#cite_note-meeks_der_standard-5">[5]</a></sup><sup id="cite_ref-6" class="reference"><a href="#cite_note-6">[6]</a></sup></p> <p>Go-oo had better support for the <a href="/wiki/Microsoft_Office" title="Microsoft Office">Microsoft Office</a> <a href="/wiki/Office_Open_XML" title="Office Open XML">OOXML</a> file formats than OpenOffice.org,<sup id="cite_ref-7" class="reference"><a href="#cite_note-7">[7]</a></sup> including write support, as well as other enhancements that had not been accepted <a href="/wiki/Upstream_(software_development)" title="Upstream (software development)">upstream</a>.<sup id="cite_ref-golem_8-0" class="reference"><a href="#cite_note-golem-8">[8]</a></sup> Many <a href="/wiki/Free_software" title="Free software">free software</a> advocates worried that Go-oo was a Novell effort to incorporate <a href="/wiki/Microsoft" title="Microsoft">Microsoft</a> technologies that might be vulnerable to <a href="/wiki/Software_patent" title="Software patent">patent</a> claims.<sup id="cite_ref-9" class="reference"><a href="#cite_note-9">[9]</a></sup> The <a href="/w/index.php?title=Hybrid_PDF&amp;action=edit&amp;redlink=1" class="new" title="Hybrid PDF (page does not exist)">hybrid PDF</a> export (<a href="/wiki/PDF" class="mw-redirect" title="PDF">PDF</a> that includes original source documents), Sun Presentation Minimizer, and other functionalities were directly available in Go-oo.</p> <p>The package branded "OpenOffice.org" in many popular <a href="/wiki/Linux_distribution" title="Linux distribution">Linux distributions</a> was in fact Go-oo, not the upstream OpenOffice.org code.<sup id="cite_ref-10" class="reference"><a href="#cite_note-10">[10]</a></sup><sup id="cite_ref-11" class="reference"><a href="#cite_note-11">[11]</a></sup><sup id="cite_ref-linux.com_12-0" class="reference"><a href="#cite_note-linux.com-12">[12]</a></sup><sup id="cite_ref-go-oo-download_13-0" class="reference"><a href="#cite_note-go-oo-download-13">[13]</a></sup></p> <p></p> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#History"><span class="tocnumber">1</span> <span class="toctext">History</span></a> <ul> <li class="toclevel-2 tocsection-2"><a href="#Versions"><span class="tocnumber">1.1</span> <span class="toctext">Versions</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-3"><a href="#Differences_between_OpenOffice.org_and_Go-oo"><span class="tocnumber">2</span> <span class="toctext">Differences between OpenOffice.org and Go-oo</span></a> <ul> <li class="toclevel-2 tocsection-4"><a href="#Advantages"><span class="tocnumber">2.1</span> <span class="toctext">Advantages</span></a> <ul> <li class="toclevel-3 tocsection-5"><a href="#Features"><span class="tocnumber">2.1.1</span> <span class="toctext">Features</span></a></li> <li class="toclevel-3 tocsection-6"><a href="#Filetype_support"><span class="tocnumber">2.1.2</span> <span class="toctext">Filetype support</span></a></li> </ul> </li> <li class="toclevel-2 tocsection-7"><a href="#Disadvantages"><span class="tocnumber">2.2</span> <span class="toctext">Disadvantages</span></a></li> <li class="toclevel-2 tocsection-8"><a href="#Other_differences"><span class="tocnumber">2.3</span> <span class="toctext">Other differences</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-9"><a href="#See_also"><span class="tocnumber">3</span> <span class="toctext">See also</span></a></li> <li class="toclevel-1 tocsection-10"><a href="#References"><span class="tocnumber">4</span> <span class="toctext">References</span></a></li> <li class="toclevel-1 tocsection-11"><a href="#External_links"><span class="tocnumber">5</span> <span class="toctext">External links</span></a></li> </ul> </div> <p></p> <h2><span class="mw-headline" id="History">History</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=1" title="Edit section: History">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>The ooo-build patchset was started at <a href="/wiki/Ximian" title="Ximian">Ximian</a> in 2003, before that company was bought by Novell. This was originally because Sun was slow to accept outside patches to OpenOffice.org, even from corporate partners.<sup id="cite_ref-14" class="reference"><a href="#cite_note-14">[14]</a></sup> Most Linux distributions used ooo-build rather than OpenOffice.org upstream code directly.<sup id="cite_ref-15" class="reference"><a href="#cite_note-15">[15]</a></sup></p> <p>Since the end of 2007,<sup id="cite_ref-golem_8-1" class="reference"><a href="#cite_note-golem-8">[8]</a></sup> various Linux distributions, including <a href="/wiki/SUSE_Linux" title="SUSE Linux">SUSE</a> in its various forms,<sup id="cite_ref-16" class="reference"><a href="#cite_note-16">[16]</a></sup> Debian and Ubuntu, had cooperated in maintaining Go-oo as a large set of patches to the upstream OpenOffice.org that, for various technical or bureaucratic reasons,<sup id="cite_ref-ITPro_2-1" class="reference"><a href="#cite_note-ITPro-2">[2]</a></sup> had not been accepted (or, in some cases, even submitted) upstream.<sup id="cite_ref-ooo-build_17-0" class="reference"><a href="#cite_note-ooo-build-17">[17]</a></sup><sup id="cite_ref-18" class="reference"><a href="#cite_note-18">[18]</a></sup><sup id="cite_ref-ooo-editions_19-0" class="reference"><a href="#cite_note-ooo-editions-19">[19]</a></sup> Others also offered Windows builds based on Go-oo, <i>e.g.</i> <a href="/wiki/OxygenOffice" class="mw-redirect" title="OxygenOffice">OxygenOffice</a> Professional and OpenOffice.org Novell Edition.</p> <p><a href="/wiki/Michael_Meeks_(software_developer)" title="Michael Meeks (software developer)">Michael Meeks</a>, from <a href="/wiki/Novell" title="Novell">Novell</a> (who also worked on OpenOffice.org and <a href="/wiki/GNOME" title="GNOME">GNOME</a>), said that the differentiation was done because <a href="/wiki/Sun_Microsystems" title="Sun Microsystems">Sun Microsystems</a> wanted to preserve the right to sell the code on a proprietary basis, as they did for <a href="/wiki/IBM_Lotus_Symphony" title="IBM Lotus Symphony">IBM Lotus Symphony</a>.<sup id="cite_ref-meeks_der_standard_5-1" class="reference"><a href="#cite_note-meeks_der_standard-5">[5]</a></sup> Sun was accused of not accepting contributions from the community.<sup id="cite_ref-slashdot_3-1" class="reference"><a href="#cite_note-slashdot-3">[3]</a></sup><sup id="cite_ref-computerworld_20-0" class="reference"><a href="#cite_note-computerworld-20">[20]</a></sup> Go-oo encouraged outside contributions, with rules similar to those later adopted for LibreOffice.<sup id="cite_ref-21" class="reference"><a href="#cite_note-21">[21]</a></sup></p> <p>In September 2010, <a href="/wiki/The_Document_Foundation" title="The Document Foundation">The Document Foundation</a> announced <a href="/wiki/LibreOffice" title="LibreOffice">LibreOffice</a> as a fully separate fork of OpenOffice.org. Go-oo was deprecated in favour of LibreOffice and Go-oo changes were incorporated into LibreOffice.</p> <div class="thumb tnone" style="margin-left: auto; margin-right:auto; overflow:hidden; width:center; max-width:1108px;"> <div class="thumbinner" style=""> <div class="overflowbugx" style="overflow:auto;"><a href="/wiki/File:StarOffice_major_derivatives.svg" class="image" title="A timeline of major derivatives of StarOffice and OpenOffice.org with Go-oo in orange"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/f/fb/StarOffice_major_derivatives.svg/1100px-StarOffice_major_derivatives.svg.png" width="1100" height="256" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/f/fb/StarOffice_major_derivatives.svg/1650px-StarOffice_major_derivatives.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/fb/StarOffice_major_derivatives.svg/2200px-StarOffice_major_derivatives.svg.png 2x" data-file-width="2055" data-file-height="478" /></a></div> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:StarOffice_major_derivatives.svg" title="File:StarOffice major derivatives.svg"></a></div> A timeline of major derivatives of StarOffice and OpenOffice.org with Go-oo in orange</div> </div> </div> <h3><span class="mw-headline" id="Versions">Versions</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=2" title="Edit section: Versions">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <p>Stable builds of Go-oo were usually available a couple of days after OpenOffice.org stable builds. Windows builds had a different last number in the version's number than Linux builds.<sup id="cite_ref-autogenerated1_22-0" class="reference"><a href="#cite_note-autogenerated1-22">[22]</a></sup> A stable version for Macintosh computers was available.<sup id="cite_ref-mac_23-0" class="reference"><a href="#cite_note-mac-23">[23]</a></sup></p> <table class="wikitable" border="1" style="width:30%"> <tr> <th colspan="2">Windows</th> <th colspan="2">Linux</th> <th colspan="2">Macintosh</th> </tr> <tr> <th style="width:45%">Version</th> <th style="width:55%">Available from</th> <th style="width:45%">Version</th> <th style="width:55%">Available from</th> <th style="width:45%">Version</th> <th style="width:55%">Available from</th> </tr> <tr> <td>2.3.0 (unstable)</td> <td>October 8, 2007</td> <td>2.3.0 (unstable)</td> <td>November 14, 2007</td> </tr> <tr> <td>2.4.0</td> <td>April 30, 2008</td> <td>2.4.0 (unstable)</td> <td>February 20, 2008</td> </tr> <tr> <td>2.4.1</td> <td>June 10, 2008</td> <td>2.4.1</td> <td>June 26, 2008</td> </tr> <tr> <td>3.0</td> <td>October 22, 2008</td> <td>3.0.0</td> <td>November 21, 2008</td> </tr> <tr> <td>3.0.1</td> <td>February 4, 2009</td> <td>3.0.1</td> <td>February 5, 2009</td> </tr> <tr> <td>3.1.0</td> <td>June 2, 2009</td> <td>3.1.0</td> <td>June 2, 2009</td> <td>3.1.0</td> <td>May 28, 2009</td> </tr> <tr> <td>3.1.1</td> <td>September 16, 2009</td> <td>3.1.1</td> <td>September 5, 2009</td> <td>3.1.1</td> <td>September 4, 2009</td> </tr> <tr> <td>3.2.0 (3.2.0-13)</td> <td>February 26, 2010</td> <td>3.2.0</td> <td>February 26, 2010</td> <td>3.2.0 (3.2.0.13)</td> <td>February 26, 2010</td> </tr> <tr> <td>3.2.1 (3.2.1-11)</td> <td>July 21, 2010</td> <td>3.2.1</td> <td>July 21, 2010</td> <td>3.2.1</td> <td>June 4, 2010</td> </tr> </table> <h2><span class="mw-headline" id="Differences_between_OpenOffice.org_and_Go-oo">Differences between OpenOffice.org and Go-oo</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=3" title="Edit section: Differences between OpenOffice.org and Go-oo">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <h3><span class="mw-headline" id="Advantages">Advantages</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=4" title="Edit section: Advantages">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li>Go-oo works faster in some operations than OpenOffice.org.<sup id="cite_ref-fastest_edition_24-0" class="reference"><a href="#cite_note-fastest_edition-24">[24]</a></sup> This makes it perform faster than OpenOffice.org.<sup id="cite_ref-derstandard_25-0" class="reference"><a href="#cite_note-derstandard-25">[25]</a></sup></li> <li>The OpenOffice.org 3.0 installation no longer includes a large number of dictionaries for writing aids (spell checker, hyphenation and thesaurus), as this impacted application performance. Localised releases may include dictionaries for particular primary and secondary languages. Dictionaries are now available as downloadable extensions, separately for each language.<sup id="cite_ref-ooo-dictionaries_26-0" class="reference"><a href="#cite_note-ooo-dictionaries-26">[26]</a></sup> Go-oo installation from version 3 on includes dictionaries in many languages, as a single extension, being a part of installation files. Inclusion of a large number of dictionaries in a default installation may affect performance.</li> <li>Better Chinese font rendering.<sup id="cite_ref-derstandard_25-1" class="reference"><a href="#cite_note-derstandard-25">[25]</a></sup></li> </ul> <h4><span class="mw-headline" id="Features">Features</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=5" title="Edit section: Features">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li>Go-oo includes 3-D transition effects in Presentations (Linux).<sup id="cite_ref-27" class="reference"><a href="#cite_note-27">[27]</a></sup></li> <li>Use of the GStreamer multimedia framework in Linux for multimedia content;<sup id="cite_ref-derstandard_25-2" class="reference"><a href="#cite_note-derstandard-25">[25]</a></sup></li> <li>Go-oo uses a combo box in place of the zoom button in stock OpenOffice.org. Newer OOo 2.x feature releases have a clickable status bar item for a zoom menu. A zoom slider was introduced to OOo 3.0 Writer and later added to OOo 3.1 Calc, Impress and Draw components.</li> <li>Go-oo Calc 2.4.x has a built in function called "Solver". It is a little different from the Solver function of the same name, which is available from OpenOffice.org 3.0. OpenOffice.org 2.4.x has no Solver.<sup class="noprint Inline-Template Template-Fact" style="white-space:nowrap;">[<i><a href="/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed"><span title="This claim needs references to reliable sources. (July 2010)">citation needed</span></a></i>]</sup></li> </ul> <h4><span class="mw-headline" id="Filetype_support">Filetype support</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=6" title="Edit section: Filetype support">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li>Go-oo can write OOXML files, and not just read them.</li> </ul> <dl> <dt>Import</dt> </dl> <ul> <li>Go-oo 2.4.x has built in support for opening Office Open XML files and brings this function also for Windows 98/ME users. (Note: OpenOffice.org 3.x has built in support for opening Office Open XML documents, but those versions of OOo cannot be installed under <a href="/wiki/Windows_98" title="Windows 98">Windows 98</a>/<a href="/wiki/Windows_ME" title="Windows ME">ME</a>.)</li> <li><a href="/wiki/Visual_Basic_for_Applications" title="Visual Basic for Applications">VBA</a> macro support;</li> <li><a href="/wiki/Microsoft_Works" title="Microsoft Works">Microsoft Works</a> filetype import;<sup id="cite_ref-derstandard_25-3" class="reference"><a href="#cite_note-derstandard-25">[25]</a></sup></li> <li><a href="/wiki/Lotus_Word_Pro" class="mw-redirect" title="Lotus Word Pro">Lotus Word Pro</a> import;</li> <li>Go-oo Draw has built-in functionality to open <a href="/wiki/Scalable_Vector_Graphics" title="Scalable Vector Graphics">SVG</a> files. OpenOffice Draw requires an extension.<sup id="cite_ref-svg_28-0" class="reference"><a href="#cite_note-svg-28">[28]</a></sup><sup id="cite_ref-29" class="reference"><a href="#cite_note-29">[29]</a></sup><sup id="cite_ref-30" class="reference"><a href="#cite_note-30">[30]</a></sup></li> <li>The PDF Import extension is included by default in Go-oo 3.0.</li> <li>Improved <a href="/wiki/Windows_Metafile" title="Windows Metafile">EMF</a> drawing;</li> <li><a href="/wiki/WordPerfect" title="WordPerfect">WordPerfect</a> Graphics import.</li> </ul> <dl> <dt>Save/Export</dt> </dl> <ul> <li>From version 3.0 on, Go-oo can save password-protected <a href="/wiki/Microsoft_Excel" title="Microsoft Excel">XLS</a> files. It uses only one basic encryption method compatible with many spreadsheet applications (for example <a href="/wiki/Gnumeric" title="Gnumeric">Gnumeric</a>).</li> <li>Go-oo 3.x can save Office Open XML files such as docx, xlsx, pptx by using Novell OpenXML Converter.<sup id="cite_ref-31" class="reference"><a href="#cite_note-31">[31]</a></sup> Because Go-oo for Windows and OpenOffice.org Novell Edition for Windows are similar, Novell OpenXML Converter can work with Go-oo 3.x.<sup id="cite_ref-novell_32-0" class="reference"><a href="#cite_note-novell-32">[32]</a></sup></li> </ul> <h3><span class="mw-headline" id="Disadvantages">Disadvantages</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=7" title="Edit section: Disadvantages">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li>Go-oo localizations are available only as language packs to the English installation.<sup id="cite_ref-go-oo-download_13-1" class="reference"><a href="#cite_note-go-oo-download-13">[13]</a></sup> Translations of the user interface and dictionaries for different languages in Go-oo are in some cases not the same as in OpenOffice.org.</li> </ul> <h3><span class="mw-headline" id="Other_differences">Other differences</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=8" title="Edit section: Other differences">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li>Go-oo uses "<a href="/wiki/Tango_Desktop_Project" title="Tango Desktop Project">Tango</a> style" application shortcut icons, quick launch icons and icons for associated files.<sup id="cite_ref-autogenerated2_33-0" class="reference"><a href="#cite_note-autogenerated2-33">[33]</a></sup><sup id="cite_ref-ooo3_34-0" class="reference"><a href="#cite_note-ooo3-34">[34]</a></sup></li> <li>Go-oo installation files were usually available for download a couple of days after OpenOffice.org builds were released.</li> <li>Go-oo for Windows was similar to OpenOffice.org Novell Edition for Windows. For example, Go-oo has version 3.0-19 and Novell Edition 3.0-22.<sup id="cite_ref-novell_32-1" class="reference"><a href="#cite_note-novell-32">[32]</a></sup></li> <li>The first time OpenOffice.org is started, a wizard opens to guide a user through the setting of user name and the registration process.<sup id="cite_ref-wizard_35-0" class="reference"><a href="#cite_note-wizard-35">[35]</a></sup> This wizard is disabled in Go-oo.</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=9" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <div role="navigation" aria-label="Portals" class="noprint portal plainlist tright" style="margin:0.5em 0 0.5em 1em;border:solid #aaa 1px"> <ul style="display:table;box-sizing:border-box;padding:0.1em;max-width:175px;background:#f9f9f9;font-size:85%;line-height:110%;font-style:italic;font-weight:bold"> <li style="display:table-row"><span style="display:table-cell;padding:0.2em;vertical-align:middle;text-align:center"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/3/31/Free_and_open-source_software_logo_%282009%29.svg/28px-Free_and_open-source_software_logo_%282009%29.svg.png" width="28" height="28" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/3/31/Free_and_open-source_software_logo_%282009%29.svg/42px-Free_and_open-source_software_logo_%282009%29.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/3/31/Free_and_open-source_software_logo_%282009%29.svg/56px-Free_and_open-source_software_logo_%282009%29.svg.png 2x" data-file-width="512" data-file-height="512" /></span><span style="display:table-cell;padding:0.2em 0.2em 0.2em 0.3em;vertical-align:middle"><a href="/wiki/Portal:Free_software" class="mw-redirect" title="Portal:Free software">Free software portal</a></span></li> </ul> </div> <ul> <li><a href="/wiki/List_of_word_processors" title="List of word processors">List of word processors</a></li> <li><a href="/wiki/Comparison_of_word_processors" title="Comparison of word processors">Comparison of word processors</a></li> <li><a href="/wiki/Office_Open_XML_software" class="mw-redirect" title="Office Open XML software">Office Open XML software</a></li> <li><a href="/wiki/OpenDocument_software" title="OpenDocument software">OpenDocument software</a></li> </ul> <h2><span class="mw-headline" id="References">References</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Go-oo&amp;action=edit&amp;section=10" title="Edit section: References">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <div class="reflist columns references-column-width" style="-moz-column-width: 30em; -webkit-column-width: 